import React from 'react';

import Grid from '@mui/material/Grid';

import classes from './Services.module.css';
import Wrapper from '../UI/Wrapper';
import services from './servicesInfo';


const servicesList = services.map((service) => {
  const { id, title, desc, icon} = service;
  return (
    <Grid item xs={12} md={6} lg={4} key={id}>
      {icon}
      <h3>{title}</h3>
      <p className={classes["justify-text"]}>{desc}</p>
    </Grid>
  )
})

const Services = () => {
  return (
    <Wrapper>
      <h2 className={classes.title}>We offer a complete <br/> range of features</h2>
      <Grid 
        container 
        columnSpacing={{ xs: 1, sm: 4, md: 12 }}
        sx={{
          textAlign: "center", 
          paddingTop: "5%",
          paddingBottom: "5%"
          }}>
        {servicesList}
      </Grid>
    </Wrapper>
  )
};

export default Services;
